import Input from '@material-ui/core/TextField';

const styleArgument = { 
    fontSize:'100px', color:'red' };

const styleInput = {
    height: '100px',
    width: '25ch',
    margin: '0px auto',
};
const styleBack = {
    background: '#ccc',
    height: '500px',
    width: '450px',
    alignItems: 'center',
    borderRadius: "16px",
    margin: '0px auto',
}

const Login = () =>{
    return(
        <h1>LOGIN</h1>,
        <div style = {styleBack}>
            <form style={styleInput}>
                <Input placeholder="YourEmail@mail.com" 
                inputProps={{ 'aria-label': 'description' }} />

            </form>
        </div>
    )
}

export default Login;
